import React from 'react'
import { render } from 'react-dom'
import '../../App.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';

export default class Navibar extends React.Component{

  constructor(props) {
    super(props);
    this.selectProductPage = this.selectProductPage.bind(this);
    this.state = {reload: true};
    var app_id = "touchAble";
  }


  //selectProductPage() { /* completing stuff */ }


  selectProductPage(app_id) {
    this.setState({reload: !this.state.reload});
    console.log("asdasdasdsd")
  };



render() {
return (
<nav class="navbar fixed-top navbar-dark navbar-expand-md bg-dark navbar-expand-md bg-faded justify-content-center">
    <a class="navbar-brand" href="#">
        <img src="./logo_zerodebug_white.png" width="30"></img>
    </a>
    <a class="navbar-brand" href="#">zerodebug</a> 
    <ul class="navbar-nav w-100 justify-content-start">
        <li class="nav-item active">
            <a class="nav-link" href="#" onClick={this.props.selectProductPage>{app_id}}>touchAble</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="//codeply.com">studiomux</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#">modstep</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#">soda</a>
        </li>
    </ul>
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsingNavbar3">
        <span class="navbar-toggler-icon"></span>
    </button>
    <div class="navbar-collapse collapse w-100" id="collapsingNavbar3">

        <ul class="nav navbar-nav ml-auto w-100 justify-content-end">
            <li class="nav-item">
                <a class="nav-link" href="#">Helpdesk</a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#">Forum</a>
            </li>
        </ul>
    </div>
</nav>



);
}
}
